import { StyledHeader } from "./style";
import Logo from "../../assets/LogoHeader.svg";
import { Link } from "react-router-dom";

export const Header = ({ logout }) => {
  return (
    <StyledHeader>
      <div>
        <img src={Logo} alt="Kenzie Hub" />
        <Link to={"/"}>Sair</Link>
      </div>
    </StyledHeader>
  );
};
